import React from 'react';
import ChartistGraph from 'react-chartist';
import Card from "../Card/Card"
import CardBody from "components/Card/CardBody.js";
import CardHeader from "components/Card/CardHeader.js";
import {
    lightlevels,
    humiditylevels,
    waterlevels
} from "variables/charts.js";

function HydroStat(props) {
    const { title, data } = props;
    return (
        <Card chart>
            <CardBody>
                <CardHeader>
                    <h4
                    style={{font}}>{title}</h4>
                </CardHeader>
                <p>{data}</p>

            </CardBody>
        </Card>
    )
}

export default function HydroSidebar() {
    return (
        <div
            style={{
                backgroundColor: "green",
                border: "none",
                position: "fixed",
                top: "0",
                bottom: "0",
                left: "0",
                width: "15vw",
            }}

        >
            <HydroStat title="Aeroponic 1" />
            <HydroStat title="Aeroponic 2" />
            <HydroStat title="Aeroponic 3" />

        </div>
    );
}
